package ru.liga.songtask.worker;

import com.leff.midi.MidiFile;
import org.assertj.core.api.Assertions;
import org.jasypt.contrib.org.apache.commons.codec_1_3.binary.Base64;
import org.junit.Assert;
import org.junit.BeforeClass;
import org.junit.Test;
import ru.liga.songtask.domain.Note;
import ru.liga.songtask.domain.NoteSign;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.util.ArrayList;
import java.util.List;

import static ru.liga.songtask.util.SongUtils.eventsToNotes;

public class AnalyzeWorkerTest {
    //{C4, S|10076, D|236}, {C#4, S|10316, D|116},{D#4, S|10436, D|796}
//    Note [] start={new Note(NoteSign.C_4, 10076L, 236L),
//            new Note(NoteSign.C_SHARP_4, 10316L, 116L),
//            new Note(NoteSign.D_SHARP_4, 10436L, 796L)};
    //{G#4, S|142320, D|118}, {G4, S|142442, D|1550}, {F4, S|143996, D|724}
//    Note [] end={new Note(NoteSign.G_SHARP_4, 142320L, 118L),
//            new Note(NoteSign.G_4, 142442L, 1550L),
//            new Note(NoteSign.F_4, 143996L, 724L)};

    static final String underneathYourClothes = "";
    static final String empty = "";
    static final String twoVoices = "";
    static List<Note> uYCVoiceTrack;
    //static List<Note> emptyVoiceTrack;
    //static List<List<Note>> twoVoicesMidi;

    static MidiFile uYCMidiFile;
    static MidiFile emptyMidiFile;
    static MidiFile twoVoicesMidiFile;

    @BeforeClass
    public static void beforeClass() {
        try {
            InputStream is = new ByteArrayInputStream(Base64.decodeBase64(underneathYourClothes.getBytes()));
            uYCMidiFile = new MidiFile(is);
            is = new ByteArrayInputStream(Base64.decodeBase64(empty.getBytes()));
            emptyMidiFile = new MidiFile(is);
            is = new ByteArrayInputStream(Base64.decodeBase64(twoVoices.getBytes()));
            twoVoicesMidiFile = new MidiFile(is);
            uYCVoiceTrack = eventsToNotes(uYCMidiFile.getTracks().get(2).getEvents());
        } catch (Exception e) {
            throw new RuntimeException(e);
        }
    }

    ///////////////////////////////////////////////////////////
    //      getVoiceTracks (MidiFile midiFile) Tests        //
    /////////////////////////////////////////////////////////

    @Test
    public void whenUYCTrackReturnOnlyoneVoiceTrack() {
        List<List<Note>> allVoiceTracks = AnalyzeWorker.getVoiceTracks(uYCMidiFile);
        //  
        Assertions.assertThat(allVoiceTracks.size()).isEqualTo(1);
    }

    @Test
    public void whenUYCTrackReturnCorrectVoiceTrack() {
        List<List<Note>> allVoiceTracks = AnalyzeWorker.getVoiceTracks(uYCMidiFile);
        //    ,      
        Assertions.assertThat(allVoiceTracks.get(0).toString()).isEqualTo(uYCVoiceTrack.toString());
    }

    @Test
    public void whenEmptyTrackReturnZeroLengthList() {
        Assertions.assertThat(AnalyzeWorker.getVoiceTracks(emptyMidiFile).size()).isEqualTo(0);
    }

    @Test
    public void whenTwoVoicesTrackReturnTwoLengthList() {
        Assertions.assertThat(AnalyzeWorker.getVoiceTracks(twoVoicesMidiFile).size()).isEqualTo(2);
    }

    ///////////////////////////////////////////////////////////////
    //      getAllTracksAsNoteLists(MidiFile midiFile) Test     //
    /////////////////////////////////////////////////////////////
    @Test
    public void whenUYCTrackReturn14() {
        List<List<Note>> allVoiceTracks = AnalyzeWorker.getAllTracksAsNoteLists(uYCMidiFile);
        Assertions.assertThat(allVoiceTracks.size()).isEqualTo(14);
    }

    @Test
    public void whenEmptyTrackReturn3Lists() {
        Assertions.assertThat(AnalyzeWorker.getAllTracksAsNoteLists(emptyMidiFile).size()).isEqualTo(3);
    }

    @Test
    public void whenTwoVoicesTrackReturn4Lists() {
        Assertions.assertThat(AnalyzeWorker.getAllTracksAsNoteLists(twoVoicesMidiFile).size()).isEqualTo(4);
    }

    ///////////////////////////////////////////////////////
    //      getExtremumNotes(List<Note> track) Test     //
    /////////////////////////////////////////////////////
    @Test
    public void whenEmptyTrackReturnNull(){
        List<Note> empty = AnalyzeWorker.getAllTracksAsNoteLists(emptyMidiFile).get(0);
        Assertions.assertThat(AnalyzeWorker.getExtremumNoteSigns(empty)).isEqualTo(null);
    }

    @Test
    public void whenOneNoteC_1TrackReturnC_1andC_1(){
        List<Note> oneNote=new ArrayList<>();
        oneNote.add(new Note(NoteSign.C_1,0L,10L));
        NoteSign [] c={NoteSign.C_1,NoteSign.C_1};
        Assertions.assertThat(AnalyzeWorker.getExtremumNoteSigns(oneNote)).isEqualTo(c);
    }

    @Test
    public void whenUYCTrackReturnG_SHARP_3andC_5(){
        NoteSign [] c={NoteSign.G_SHARP_3,NoteSign.C_5};
        Assertions.assertThat(AnalyzeWorker.getExtremumNoteSigns(uYCVoiceTrack)).isEqualTo(c);
    }

    ///////////////////////////////////////////////////////
    //      getRange(NoteSign [] extremeNotes) Test     //
    /////////////////////////////////////////////////////
    @Test
    public void whenEmptyExtremumReturnNull(){
        NoteSign [] noteSigns=null;
        Assertions.assertThat(AnalyzeWorker.getRange(noteSigns)).isEqualTo(null);
    }

    @Test
    public void whenOneNoteExtremumReturn0(){
        NoteSign [] c={NoteSign.C_1,NoteSign.C_1};
        Assertions.assertThat(AnalyzeWorker.getRange(c)).isEqualTo(0);
    }

    @Test
    public void whenUYCExtremumsReturn16(){
        NoteSign [] c={NoteSign.G_SHARP_3,NoteSign.C_5};
        Assertions.assertThat(AnalyzeWorker.getRange(c)).isEqualTo(16);
    }

}